CREATE TABLE `cms_article` (
  `ID_ARTICLE` smallint(6) NOT NULL AUTO_INCREMENT,
  `ID_CAT` smallint(6) NOT NULL,
  `PARENT_ID` smallint(6) NOT NULL,
  `id_notice` int(11) DEFAULT NULL,
  `ID_LIEU` int(11) DEFAULT NULL,
  `titre` varchar(255) DEFAULT NULL,
  `DESCRIPTION` text NOT NULL,
  `CONTENU` text,
  `DEBUT` date DEFAULT NULL,
  `FIN` date DEFAULT NULL,
  `AVIS` tinyint(4) NOT NULL,
  `TAGS` text,
  `DATE_CREATION` datetime NOT NULL,
  `DATE_MAJ` datetime NOT NULL,
  `EVENTS_DEBUT` datetime DEFAULT NULL,
  `EVENTS_FIN` datetime DEFAULT NULL,
  `ALL_DAY` tinyint(1) unsigned DEFAULT NULL,
  `INDEXATION` tinyint(4) NOT NULL DEFAULT '0',
  `CACHER_TITRE` tinyint(1) NOT NULL,
  `LANGUE` varchar(5) NOT NULL,
  `STATUS` tinyint(1) unsigned DEFAULT NULL,
  `DOMAINE_IDS` varchar(100) NOT NULL DEFAULT '',
  `ID_ORIGINE` varchar(255) DEFAULT NULL,
  `REFUS_MESSAGE` text,
  `ID_USER` int(11) DEFAULT NULL,
  `pick_day` varchar(255) DEFAULT NULL,
  `destination_email` varchar(255) DEFAULT NULL,
  `REPOSITORY_ORIGINE` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID_ARTICLE`),
  KEY `DATE_CREATION` (`DATE_CREATION`),
  KEY `EVENTS_DEBUT` (`EVENTS_DEBUT`),
  KEY `EVENTS_FIN` (`EVENTS_FIN`),
  KEY `ID_CAT` (`ID_CAT`),
  KEY `STATUS` (`STATUS`),
  KEY `DEBUT` (`DEBUT`),
  KEY `FIN` (`FIN`),
  KEY `ID_LIEU` (`ID_LIEU`),
  KEY `ID_ORIGINE` (`ID_ORIGINE`)
) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=utf8;
